import React from 'react';

interface props {
    isConnected : boolean
}

const sshStatus: React.FC<props> = ({ isConnected }) => {
    return (
        <div>
            <h2>SSH Connection Status</h2>
            {isConnected ? (
                <p style={{ color: 'green' }}>Connected</p>
            ) : (
                <p style={{ color: 'red' }}>Not Connected</p>
            )}
        </div>
    );
};

export default sshStatus;
